import React from "react";

function PersonForm(props) {
  const update = props.update;

  return (
    <>
      <ul>
        {update.map((item) => (
          <li>{item.name}</li>
        ))}
      </ul>
      <form onSubmit={props.handleChange}>
        <div>
          <input
            type="text"
            value={props.value}
            onChange={props.onChange}
            id={props.id}
            name={props.name}
          />
        </div>
      </form>
    </>
  );
}

export default PersonForm;
